import './App.css';
import Header from './components/Header';

const App = () => {
  return (

      <div className='app-wrapper'>
        <Header/>

        <div className='content'>
         <div className='cover'> 
           <img src='https://www.viaggiarenews.com/files/viaggiarenews.com/2020/02/beach-1867271_1920-1030x687.jpg'/>
         </div>
         <div>Avatar + info </div>
         <div>My post
           <div>new post</div>
           <div>post 1</div>
           <div>post 2</div>
         </div>
        </div>
      </div>
  );
}

export default App;
